prog:
//
// See the play button in the top right? It looks like a black triangle.
// Hit that to get started!
//
// CHALLENGE 3: The knight can walk to the right, but can't walk to the left!
//              Click on the knight to focus the game screen.
//              Press the right arrow key to make the knight walk to the right.
//
//              Read through the code below and try changing the code to make
//              the knight walk to the left.
//

const e = createEngine(gameCanvas, 300, 300);

/* BEGIN TEXT */
e.addText("now the goofball forgot", 145, 96, { size: 18 });
e.addText("how to walk backwards", 164, 120, { size: 18 });

e.addText("how's he ever gonna", 83, 205, { size: 12 });
e.addText("get to his bird?", 89, 220, { size: 12 });
e.addText("|", 53, 237, { size: 12 });
e.addText("v", 53, 248, { size: 12 });
/* END TEXT */

/* BEGIN KNIGHT */
e.add({
  sprite: knight,
  scale: 3,
  x: 170, 
  y: 236,
  update: (me) => {
    if (e.heldKey("ArrowRight")) {
      me.x += 3;
    }
  }
});
/* END KNIGHT */

/* BEGIN CAGE */
e.add({ sprite: painting, x: 20, y: 254, scale: 3, collides: me => e.remove(me) })
/* END CAGE */

e.start();
